import { useParams } from "react-router";

interface Params {
    [key: string]: string | undefined;
    coinId: string;
    coinPrice: string;
}
function Coin() {
    const { coinId, coinPrice } = useParams<Params>();
    // console.log(params);
    // coinPrice를 숫자로 변환
    const price = coinPrice ? parseFloat(coinPrice) : 0;

    return (
        <h1>
            Coin: {coinId} &rarr; {price}
        </h1>
    );
}

export default Coin;
